import './App.css'
import { useRef } from 'react';
import { useEffect } from 'react';


const imageData=`data:image/png;base64,`

function App() {



  const canvasRef=useRef()
  const renderRefernce=useRef(false)

  useEffect(()=>{

    if(renderRefernce.current){

     //load image     
     let image= new Image()
     image.src=imageData

     image.onload=function(){
      const ctx=canvasRef.current.getContext('2d')


      const effect= new Effect(canvasRef.current.height,canvasRef.current.width,ctx,image)
    

      effect.init()

     ctx.clearRect(0,0,canvasRef.current.width,canvasRef.current.height)
      effect.draw()
      function animate(){
      ctx.clearRect(0,0,canvasRef.current.width,canvasRef.current.height)
      effect.draw()
      effect.update()
        requestAnimationFrame(animate)
      }
      animate()
     }
      
    }
    
    renderRefernce.current=true
  },[canvasRef.current])

  class Particle{
     constructor(x,y,size,ctx,effect,color){
      this.effect=effect
      this.x=x
      this.y= y
      this.originX=Math.floor(x)
      this.originY=Math.floor(y)
      this.size=size
      this.ctx=ctx
      this.vx=Math.random(5) -1
      this.vy=Math.random(2)-1
      this.color=color
      this.dx=0
      this.dy=0
      this.force=0
      this.distance=0
      this.friction=0.95
      this.angle=0
      this.ease= 0.01
      //this.ctx.drawImage(this.image,0,0)
     }

     draw(){
     this.ctx.fillStyle=this.color
     this.ctx.fillRect(this.x,this.y,this.size,this.size)
     }

     update(){
      // here we need to get some speed based properties
      // get distance 

      if(this.effect.mouse.x && this.effect.mouse.y){
        this.dx= this.x - this.effect.mouse.x 
        this.dy= this.y - this.effect.mouse.y   
        this.distance=  (this.dx * this.dx) + (this.dy * this.dy )
        this.force= this.effect.mouse.radius / this.distance 
        this.angle = Math.atan2(this.dy, this.dx);
  
        
        if(this.distance <= this.effect.mouse.radius){
          this.vx += this.force * Math.cos(this.angle) 
          this.vy += this.force * Math.sin(this.angle)
          
        }
        this.x+=  (this.vx *= this.friction) + (this.originX-this.x)   * this.ease // multiple by force
        this.y+= (this.vy *=   this.friction) + (this.originY - this.y)  * this.ease
      }

      
     }
  }
  class Effect{
     constructor(height,width,ctx,image){
      this.height=height
      this.width=width
      this.particleArray=[]
      this.ctx=ctx
      this.image=image
      this.centralX=width * 0.5
      this.centralY= height * 0.5
      this.horizontalX=Math.floor(this.centralX - this.image.width *0.5)
      this.horizontalY=Math.floor(this.centralY - this.image.height *0.5)
      
      this.gap=6

      this.mouse={
        radius:3000,
        x:undefined,
        y:undefined
      }

      window.addEventListener("mousemove",(event)=>{
        this.mouse.x=event.x 
        this.mouse.y=event.y  
        
      })

     }
     init(){
      this.ctx.drawImage(this.image,this.horizontalX,this.horizontalY)
      // we need to get the iamge Data 
    
      let imageDataArray= this.ctx.getImageData(0,0,this.width,this.height).data
      
      // we need to loop through the array 

      for (let y=0; y<= this.height; y+=this.gap ){

        for(let x=0; x<= this.width; x+= this.gap){
           let position= (this.width * y +x)    *4
           let r=imageDataArray[position]
           let g= imageDataArray[position +1]
           let b= imageDataArray[position +2]
           let a=imageDataArray[position + 3]
            
           // then we need to get the color 

           let color = "rgb(" + r + ", " + g + ", " + b + ")";

           // the if the data have color we need to add that in to an array 
           
           if(a > 0  && (r <234  || g <234   || b <234   )){
             this.particleArray.push(new Particle(x,y,10,this.ctx,this,color))
           }
           

        }

      }
      
     }

     draw(){
       this.particleArray.forEach((particle)=> particle.draw())
     }

     update(){
      this.particleArray.forEach((particle)=> particle.update())
     }
  }
  


  return (
    <div className="App">
      
      
      <canvas ref={canvasRef} height={956} width={1831} style={{backgroundColor:"blue"}}>
      
      </canvas>
      
    </div>
  );
}

export default App;

